class Route extends React.Component {
    state = {
        mainStore: "Colombo",
        routeCount: 15
    }
    render() {
        return (
            <div style={{ minHeight: "110px", backgroundColor: 'pink' }} className="m-5 p-3">
                <div className="row">
                    <div className="col-6">oiajsd</div>
                    <div className="col-6"></div>
                </div>
            </div>
        );
    }
}

export default Route;
